  false,\n\t\"url\": null,\n\t\"notes\": \"The NOAA Ocean Surface Bundle (OSB) Climate
  Data Record (CDR) consist of three parts: sea surface temperature, near-surface
  atmospheric properties, and heat fluxes. This portion of the OSB CDR is the NOAA
  Climate Data Record (CDR) of Sea Surface Temperature - WHOI. The SST data are found
  through modeling the diurnal variability in combination with AVHRR observations
  of sea surface temperature. The data cover a time period from January 1988 - December
  2007 at a 3-hourly, quarter-degree resolution.\",\n\t\"license_title\": null,\n\t\"extras\":
